			},
			["customText"] = "function ()\n    local function round(num, idp)\n        local mult = 10 ^ (idp or 0);\n        return math.floor(num * mult + 0.5) / mult;\n    end\n    \n    local libram_id  = GetInventoryItemID( \"player\", 18 )\n    local holyShield_blockValue = 30\n    if( libram_id == 29388 ) then\n        holyShield_blockValue = 35.33\n    end\n    local def = GetDodgeBlockParryChanceFromDefense()\n    local miss = round(def + 5, 2)\n    local dodge = round(GetDodgeChance(), 2)\n    local parry = round(GetParryChance(), 2)\n    local block = round(GetBlockChance(), 2)\n    local bv = round(GetShieldBlock(), 2)\n    local avoidance = round((miss + dodge + parry), 2)\n    local resil = GetCombatRatingBonus(15)\n    local crit = round(def + resil, 2)\n    local ct = round(avoidance + block, 2)\n    -- Illidan Uncrush\n    local illy = round(dodge + parry + block, 2)\n    local critcolor = \"|cffff0000\"..crit..\"|r\"\n    local ctcolor = \"|cffff0000\"..ct..\"|r\"\n    local illycolor = \"|cffff0000\"..illy..\"|r\"\n    local holy = GetSpellBonusDamage(2)\n    local sphit = round((GetCombatRatingBonus(8) + GetHitModifier()), 2)\n    local baseArmor, effectiveArmor, armor, posBuff, negBuff = UnitArmor(\"player\")\n    -- Damage reduction from armor\n    local dr = (effectiveArmor / ((73 * 467.5) + effectiveArmor - 22167.5))\n    -- Adding Improved righteous fury to the Damage reduction    \n    local name, rank, icon, castTime, minRange, maxRange = GetSpellInfo(25780);\n    if AuraUtil.FindAuraByName(name, \"player\", \"HELPFUL\") ~= nil then\n        local nameTalent, icon, tier, column, currRank, maxRank= GetTalentInfo(2,7);\n        dr = 1-(1-dr)*(1-(.02*currRank));\n    end\n    \n    local max_health = UnitHealthMax(\"player\")\n    local eh = max_health / (1 - dr )\n    dr = round(min(dr,0.75)*100,4);\n    \n    \n    if crit >= 5.6 then\n        critcolor = \"|cff00ff00\"..crit..\"|r\"\n    end\n    \n    if ct >= 102.4 then\n        ctcolor = \"|cff00ff00\"..ct..\"|r\"\n    elseif ct >= (102.4 - holyShield_blockValue) then\n        ctcolor = \"|cffffff00\"..ct..\"|r\"\n    end\n    if illy >= 102.4 then\n        illycolor = \"|cff00ff00\"..illy..\"|r\"\n    end\n    -- NOTE: Due to uncertainty over if Illidan needs 102.4% or 101.8% avoidance without miss, I have color coded it to RED if below 101.8, Yellow if between 101.8 and 102.3 and green if 102.4 or higher. So you're probably safe if it's yellow, and definitely safe if it is green.\n    if illy >= 102.4 then\n        illycolor = \"|cff00ff00\"..illy..\"|r\"\n    elseif illy >= 101.8 then\n        illycolor = \"|cffffff00\"..illy..\"|r\"\n    end\n    \n    return \"|cff00ccff\"..string.format(\"%.2f\", miss)..\"%|r\",\n    \"|cff00ccff\"..string.format(\"%.2f\", dodge)..\"%|r\",\n    \"|cff00ccff\"..string.format(\"%.2f\", parry)..\"%|r\",\n    \"|cffDA70D6\"..string.format(\"%.2f\", avoidance)..\"%|r\",\n    \"|cff00E5EE\"..string.format(\"%.2f\", block)..\"%|r\",\n    critcolor,\n    ctcolor,\n    \"|cffFF4500\"..string.format(\"%.0f\", bv)..\"|r\",\n    \"|cffffff00\"..string.format(\"%.0f\", holy)..\"|r\",\n    \"|cffFF4500\"..string.format(\"%.0f\", effectiveArmor)..\"|r\",\n    \"|cffFF4500\"..string.format(\"%.2f\", dr)..\"%|r\",\n    \"|cffFF4500\"..string.format(\"%.0f\", eh)..\"|r\",\n    illycolor,\n    \"|cffffff00\"..string.format(\"%.2f\", sphit)..\"|r\"\nend",
