			["displayText"] = "",
			["customText"] = "function()\n    if WeakAuras.IsOptionsOpen() then return end\n    if not aura_env.last or aura_env.last < GetTime() - 1.5 then\n        aura_env.last = GetTime()\n        SendChatMessage(\"{X} RUN AWAY {X}\") -- replace the message as needed\n    end\nend",
			["shadowYOffset"] = -1,
			["anchorPoint"] = "CENTER",
			["cooldownSwipe"] = true,
			["displayText_format_p_time_format"] = 0,
			["customTextUpdate"] = "event",
			["url"] = "https://wago.io/llwrZsg_d/28",
			["icon"] = true,
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["subeventSuffix"] = "_CAST_START",
						["custom_type"] = "stateupdate",
						["event"] = "Health",
						["unit"] = "player",
						["customDuration"] = "",
						["customName"] = "",
						["custom"] = "function(allstates)\n    if not aura_env.last or (GetTime() - aura_env.last) > aura_env.config[\"ThrottleThreshold\"] then\n        aura_env.last = GetTime()\n        \n        -- Check air phase timer (see other trigger for emote check)\n        if aura_env.air_phase_ts and (GetTime() - aura_env.air_phase_ts) > aura_env.airphase_duration then\n            aura_env.air_phase_ts = nil\n        end\n        if aura_env.air_phase_ts then return end\n        \n        -- Scan for boss unit id\n        local unit = aura_env.get_unit_by_name(aura_env.boss_name)\n        if not unit then return end\n        \n        -- Keep track of target changes\n        local unit_target = unit .. \"target\"\n        aura_env.unit_target_name_old = aura_env.unit_target_name\n        aura_env.unit_target_name = UnitName(unit_target)\n        \n        -- Check if target changed\n        if aura_env.unit_target_name_old ~= aura_env.unit_target_name then\n            -- Check if unit exists\n            if UnitExists(unit_target) then\n                -- Check if target is not tanking (check for false because isTanking=nil if cannot retrieve threat)\n                local isTanking, status, threatpct, rawthreatpct, threatvalue = UnitDetailedThreatSituation(unit_target, unit)\n                if isTanking == false then\n                    -- Create state\n                    allstates[\"encap\"] = {\n                        show = true,\n                        changed = true,\n                        progressType = \"timed\",\n                        duration = aura_env.encap_duration,\n                        expirationTime = GetTime()+aura_env.encap_duration,\n                        encap_target_name = aura_env.unit_target_name,\n                        autoHide = true,\n                    }\n                    \n                    if aura_env.config[\"MarkEncapTarget\"] then\n                        SetRaidTarget(unit_target,8)\n                    end\n                end\n            end\n        end\n        \n        -- Check if state is active\n        local state = allstates[\"encap\"]\n        if state then\n            -- For keeping track of range (when you run further than 20 yards from encapsulate, it will re-trigger and update)\n            state.condition_val_old = state.condition_val\n            \n            -- Check if encapsulate on player, near player, or far away\n            if UnitIsUnit(\"player\",state.encap_target_name) then\n                state.condition_val = \"me\"\n                state.name = \"ENCAP ON YOU\"\n            elseif WeakAuras.CheckRange(state.encap_target_name,20,\"<=\") then\n                -- Actually ~23yd range check because of API limitations\n                state.condition_val = \"near\"\n                state.name = state.encap_target_name\n            else\n                state.condition_val = \"far\"\n                state.name = state.encap_target_name\n            end\n            \n            -- Trigger only when something changed\n            if state.condition_val_old ~= state.condition_val then\n                state.changed=true\n                return true\n            end\n        end\n    end\nend",
