				["init"] = {
					["custom"] = "-- Boss name and Encapsulate Duration\naura_env.boss_name = \"Felmyst\"\naura_env.encap_duration = 7.2 -- ~1.2s of targeting into ~6s of debuff\n\n-- Air Phase Configuration\naura_env.airphase_duration = 99\naura_env.airphase_emote = \"I am stronger than ever before!\"\n\n-- Scans through raid member targets and nameplates to find the input unit name and returns the unit id\naura_env.get_unit_by_name = function(in_unit_name)\n    local list_units = {}\n    \n    -- Get all raid member targets \n    for unit in WA_IterateGroupMembers() do\n        table.insert(list_units,unit .. \"target\")\n    end\n    \n    -- Get all nameplates\n    for k,v in pairs(C_NamePlate.GetNamePlates()) do\n        local unit = v.namePlateUnitToken\n        if unit then\n            table.insert(list_units,unit)\n        end\n    end\n    \n    -- Loop through raid member targets & nameplates\n    for _,unit in pairs(list_units) do\n        if UnitName(unit) == in_unit_name then\n            return unit\n        end\n    end\n    \n    return\nend",
